import React from "react"
import { ReactDOM } from "react"
import UseFetchExchange from "./useFetchExchange";
import UseFetchCurrencies from "./useFetchCurrencies";

export default function TestFetch() {
    const data = UseFetchExchange('USD', 'VND');
    const [list] = UseFetchCurrencies();

    return (
        <>
            <h1>{data}</h1>
            <ul>
                {list && list.map(
                    (currency, index) => {
                        return (
                            <li key={index}>{currency}</li>
                        )
                    }
                )}
            </ul>
        </>
    )
}
